'''HYENA'''是出自BEMANI系列音乐游戏联动活动《热斗！BEMANI STADIUM》的曲目。


{{#widget:YouTube|id=vfEdpBUIfos}}

== 简介 ==
活动前半战收录乐曲，曲目作者为SOUND VOLTEX公募曲采用回数最多的作者Hommarju的作曲。在之前，也有直接作为原创曲收录BEMANI的情况。<s>这算准入社吗？</s>

无论哪种机型收录的谱面，都有纵连横行倾向。尤其是IIDX和DDR，纵连数出现很夸张，甚至使其成为了高难度曲目。

但是，最夸张的机种当属SOUND VOLTEX版本，里面出现了大量的直角音符，超越了之前的记录192回成为最高记录308回。由于需要频繁地搓动旋钮，所以会加速旋钮编码器的磨损，被评为“毁机神曲”。

